import{_ as e,c as t,o as i,ag as r}from"./chunks/framework.BVgKs9HZ.js";const k=JSON.parse('{"title":"Android安装环境配置","description":"基于jdk1.7+eclipse+adt+sdk进行搭建android开发环境的过程","frontmatter":{"title":"Android安装环境配置","date":"2016-03-12T23:55:55.000Z","tags":["学习"],"description":"基于jdk1.7+eclipse+adt+sdk进行搭建android开发环境的过程"},"headers":[],"relativePath":"post/diary/2016-2017/2016-3-12.md","filePath":"post/diary/2016-2017/2016-3-12.md"}'),l={name:"post/diary/2016-2017/2016-3-12.md"};function s(n,a,o,d,h,c){return i(),t("div",null,a[0]||(a[0]=[r('<h3 id="jdk安装" tabindex="-1">jdk安装 <a class="header-anchor" href="#jdk安装" aria-label="Permalink to &quot;jdk安装&quot;">​</a></h3><ul><li>略.</li></ul><h3 id="myeclipse安装及破解" tabindex="-1">Myeclipse安装及破解 <a class="header-anchor" href="#myeclipse安装及破解" aria-label="Permalink to &quot;Myeclipse安装及破解&quot;">​</a></h3><ul><li>略.</li></ul><h3 id="adt安装" tabindex="-1">ADT安装 <a class="header-anchor" href="#adt安装" aria-label="Permalink to &quot;ADT安装&quot;">​</a></h3><ul><li>ADT是myeclipse中进行android开发而制作的插件，安装ADT后就可以对sdk等进行在线更新</li><li><a href="http://tools.android-studio.org/index.php/adt-bundle-plugin" target="_blank" rel="noreferrer">ADT下载地址</a></li><li><a href="http://jingyan.baidu.com/article/19020a0a0c1579529d284235.html" target="_blank" rel="noreferrer">ADT配置方法</a> 实际安装时会有出入， 选择install from site即可，然后选择本地rar格式的adt下载包即可，最好安装tools里所有的插件.</li></ul><h3 id="sdk安装" tabindex="-1">SDK安装 <a class="header-anchor" href="#sdk安装" aria-label="Permalink to &quot;SDK安装&quot;">​</a></h3><ul><li><a href="http://tools.android-studio.org/index.php/sdk" target="_blank" rel="noreferrer">sdk工具下载地址</a>. 这里需要注意系统的64位还是32位的，而且安装包里面avd和sdk均会包含。</li><li><a href="http://www.cnblogs.com/VincentHome/archive/2012/08/30/2664484.html" target="_blank" rel="noreferrer">sdk下载教程</a> 这是默认安装方法，如果下载 特别慢，有时候我们需要镜像网址</li><li><a href="http://blog.csdn.net/boonya/article/details/38752647" target="_blank" rel="noreferrer">镜像安装sdk</a> 可以尝试不同的镜像网站，我下载使用中科院的镜像最快，可以达到300kB/s.</li><li><a href="http://www.nowamagic.net/academy/detail/50280277%E3%80%82" target="_blank" rel="noreferrer">下载内容不见的解决方法</a> 一个镜像地址不显示，换一个就可以显示了</li><li><a href="http://jingyan.baidu.com/article/36d6ed1f5fd2e71bcf488398.html" target="_blank" rel="noreferrer">sdk manager图标不见了的解决方法</a></li><li><a href="http://www.shoutmon.com/how-to-solve-cpuabi-no-system-images-installed-for-this-target.html" target="_blank" rel="noreferrer">模拟器无法配置的问题1及解决方法</a> 就是sdk没下载完整，再把那几个没有下载的下载就可以了。</li><li><a href="http://zhidao.baidu.com/link?url=ll1d5wGbZkANSBNkjTJV3KHtV49HUJTdmoUvZtaJ77X6_2TcNbFUEFE0GSlE5uIWYNLoPoj5XpyHILPvE15g9a" target="_blank" rel="noreferrer">第一次建工程后无法加载模拟器的解决方法</a> 注:Myeclipse 里面不是project...而是run-configuration.原因很简单，是因为建工程在见模拟器之前导致模拟器无法加载上，在Run-configuration 里面删除掉new的那一个后，新建立的工程就能加载模拟器了。</li></ul><h3 id="喂" tabindex="-1">喂~ <a class="header-anchor" href="#喂" aria-label="Permalink to &quot;喂~&quot;">​</a></h3><div class="language-java vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">java</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">System.out.</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">println</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;hello,2016&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">);</span></span></code></pre></div>',10)]))}const u=e(l,[["render",s]]);export{k as __pageData,u as default};
